import React from "react";
import {
  NavBarWrap,
  Links,
  DropDown,
  DropDownContents,
  Logo,
} from "./styledNav";
import NavLink from "./NavLink";

const NavBar = () => {
  let isLogin = false;

  return (
    <NavBarWrap>
      <Logo to="/">SantaIsSanta</Logo>
      <Links>
        <DropDown>
          지역별
          <DropDownContents>
            <NavLink goto="/" contents="수도권" className="dropdowncotents" />
            <NavLink goto="/" contents="강원도" className="dropdowncotents" />
            <NavLink goto="/" contents="경상도" className="dropdowncotents" />
            <NavLink goto="/" contents="전라도" className="dropdowncotents" />
            <NavLink goto="/" contents="충청도" className="dropdowncotents" />
            <NavLink goto="/" contents="제주도" className="dropdowncotents" />
          </DropDownContents>
        </DropDown>
      </Links>
    </NavBarWrap>
  );
};

export default NavBar;
